webpackJsonp([0xd2e536eda26c],{497:function(e,t){e.exports={data:{wordpressPage:{id:"73601432-4c1b-5c68-abcc-d07b6be4bb97",content:'<section class="white" style="" id=""><div class="container">\r\n<h1 class="medium text-center title" style="">Privacy Policy</h1>\r\n<div class="text-block " style="">This Privacy Policy governs the manner in which TagPrints Digital collects, uses, maintains and discloses information collected from users (each, a &#8220;User&#8221;) of the Tagprints.com website (&#8220;Site&#8221;). This privacy policy applies to the Site and all products and services offered by TagPrints Digital.</div>\r\n<h1 class="xs text-left title" style="">Personal identification information</h1>\r\n<div class="text-block " style="">We may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, register on the site, subscribe to the newsletter, fill out a form, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, phone number. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.</div>\r\n<h1 class="xs text-left title" style="">Non-personal identification information</h1>\r\n<div class="text-block " style="">We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.</div>\r\n<h1 class="xs text-left title" style="">Web browser cookies</h1>\r\n<div class="text-block " style="">Our Site may use &#8220;cookies&#8221; to enhance User experience. User&#8217;s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.</div>\r\n<h1 class="xs text-left title" style="">How we use collected information</h1>\r\n<div class="text-block " style="">TagPrints Digital may collect and use Users personal information for the following purposes:\r\n<ul>\r\n<li>To improve customer service\r\n<ul><li>Information you provide helps us respond to your customer service requests and support needs more efficiently.</li></ul></li>\r\n<li>To personalize user experience<ul><li>We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.</li></ul></li>\r\n<li>To improve our Site<ul><li>We may use feedback you provide to improve our products and services.</li></ul></li>\r\n<li>To send periodic emails<ul><li>We may use the email address to send User information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc. If at any time the User would like to unsubscribe from receiving future emails, they may do so by contacting us via our Site.</li></ul></li>\r\n</ul>\r\n</div>\r\n<h1 class="xs text-left title" style="">How we protect your information</h1>\r\n<div class="text-block " style="">We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.</div>\r\n<h1 class="xs text-left title" style="">Sharing your personal information</h1>\r\n<div class="text-block " style="">We do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.We may use third party service providers to help us operate our business and the Site or administer activities on our behalf, such as sending out newsletters or surveys. We may share your information with these third parties for those limited purposes provided that you have given us your permission.</div>\r\n<h1 class="xs text-left title" style="">Changes to this privacy policy</h1>\r\n<div class="text-block " style="">TagPrints Digital has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.</div>\r\n<h1 class="xs text-left title" style="">Your acceptance of these terms</h1>\r\n<div class="text-block " style="">By using this Site, you signify your acceptance of this policy. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.</div>\r\n<h1 class="xs text-left title" style="">Contacting us</h1>\r\n<div class="text-block " style="">If you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us at:<br /><br />\r\nTagPrints Digital<br />\r\nTagprints.com<br />\r\n747 Church Rd. Suite A2<br />\r\nElmhurst, IL 60126<br />\r\n630.948.7779<br />\r\nhello@tagprints.com<br /><br />\r\nThis document was last updated on October 27th, 2015</div>\r\n</div></section>',title:"Privacy Policy",date:"March 15, 2018",yoast:{title:"",description:"",keywords:""}},site:{id:"Site",siteMetadata:{title:"A sample site using gatsby-source-wordpress",subtitle:"Data fetched from a site hosted on wordpress.com"}}},pathContext:{id:"73601432-4c1b-5c68-abcc-d07b6be4bb97"}}}});
